import{_ as t,c as r,o,ag as a}from"./chunks/framework.B-XtCDNB.js";const h=JSON.parse('{"title":"Contribution Guide","description":"","frontmatter":{},"headers":[],"relativePath":"contribute/overview.md","filePath":"contribute/overview.md","lastUpdated":1747172293000}'),s={name:"contribute/overview.md"};function i(n,e,u,l,c,p){return o(),r("div",null,[...e[0]||(e[0]=[a('<h1 id="contribution-guide" tabindex="-1">Contribution Guide <a class="header-anchor" href="#contribution-guide" aria-label="Permalink to &quot;Contribution Guide&quot;">​</a></h1><p>Deskulpt welcomes all sorts of contributions, no matter how large or small!</p><h2 id="open-development" tabindex="-1">Open Development <a class="header-anchor" href="#open-development" aria-label="Permalink to &quot;Open Development&quot;">​</a></h2><p>The Deskulpt project is hosted on GitHub: <a href="https://github.com/CSCI-SHU-410-SE-Project/Deskulpt" target="_blank" rel="noreferrer">https://github.com/CSCI-SHU-410-SE-Project/Deskulpt</a>. We are a community based on openness and friendly, didactic discussions. We aspire to value everyones&#39; contributions, and we are committed to providing a safe and welcoming environment for all. Decision-making is based on technical merit and concensus. Please refer to our <a href="https://github.com/CSCI-SHU-410-SE-Project/Deskulpt/blob/main/.github/CODE_OF_CONDUCT.md" target="_blank" rel="noreferrer">Code of Conduct</a> for more information.</p><h2 id="bug-reports" tabindex="-1">Bug Reports <a class="header-anchor" href="#bug-reports" aria-label="Permalink to &quot;Bug Reports&quot;">​</a></h2><p>Please report bugs to the <a href="https://github.com/CSCI-SHU-410-SE-Project/Deskulpt/issues" target="_blank" rel="noreferrer">issue tracker</a> after you have searched for previous issues and found no results. Please be as descriptive as possible. If applicable, please include your environment, software versions, widget codes, etc. so that the issue can be more easily reproducible.</p><h2 id="feature-requests" tabindex="-1">Feature Requests <a class="header-anchor" href="#feature-requests" aria-label="Permalink to &quot;Feature Requests&quot;">​</a></h2><p>Before requesting new features, please make sure to look through the <a href="https://github.com/CSCI-SHU-410-SE-Project/Deskulpt/issues" target="_blank" rel="noreferrer">issue tracker</a> as your request may already exist. If it does not, submit an issue with title prefixed with <code>[feat]</code>. Please be as descriptive as possible, including necessary illustrations if applicable.</p><h2 id="submitting-pull-requests" tabindex="-1">Submitting Pull Requests <a class="header-anchor" href="#submitting-pull-requests" aria-label="Permalink to &quot;Submitting Pull Requests&quot;">​</a></h2><p>We accept pull requests for bug fixes, improvements, new features, and documentation. Pull requests should be made from your own fork of the Deskulpt project towards the <code>main</code> branch, with the &quot;Allow edits by maintainers&quot; option checked. All pull requests need to pass our contiguous integration (CI) and go through the same review process. If your pull request is not yet ready for review, please <a href="https://docs.github.com/en/pull-requests/collaborating-with-pull-requests/proposing-changes-to-your-work-with-pull-requests/changing-the-stage-of-a-pull-request" target="_blank" rel="noreferrer">mark it as a draft</a>. Please move on read the other relevant sections in our contribution guide before you start.</p>',10)])])}const b=t(s,[["render",i]]);export{h as __pageData,b as default};
